Private Snafu is the title character of a series of black-and-white American instructional cartoon shorts produced between 1943 and 1945 during World War II. The character was created by director Frank Capra, chairman of the U.S. Army Air Force First Motion Picture Unit, and most were written by Theodor &quot;Dr. Seuss&quot; Geisel, Philip D. Eastman, and Munro Leaf
